With cargo you can install binary dependencies (bindeps) as well with cargo install command. We don't have such easy facilities available in bazel besides specifying it as a dependency. To mimic cargo's bindeps feature we use the unstable feature called artifact-dependencies which integrates well with bazel concepts. You could use the syntax specified in the above document to place it in Cargo.toml. For that you can consult the following example . This method has the following consequences: if you use shared dependency tree with your project these binary dependencies will interfere with yours (may conflict) you have to use nightly host_tools to generate dependencies because Alternatively you can specify this in a separate repo with cargo.from_specs syntax: bindeps = use_extension("@rules_rust//crate_universe:extension.bzl", "crate") bindeps.spec(package = "cargo-machete", version = "=0.7.0", artifact = "bin")
