In cases where Rust targets have heavy interractions with other Bazel targests ( Cc , Proto , etc.), maintaining Cargo.toml files may have deminishing returns as things like rust-analyzer begin to be confused about missing targets or environment variables defined only in Bazel. In workspaces like this, it may be desirable to have a "Cargo free" setup. crates_repository supports this through the packages attribute. load("@rules_rust//crate_universe:defs.bzl", "crate", "crates_repository", "render_config") crates_repository( name = "crate_index", cargo_lockfile = "//:Cargo.lock", lockfile = "//:Cargo.Bazel.lock", packages = { "async-trait": crate.spec( version = "0.1.51", ), "mockall": crate.spec( version = "0.10.2", ), "tokio": crate.spec( version = "1.12.0", ), }, # Setting the default package name to `""` forces the use of the macros defined in this repository # to always use the root package when looking for dependencies or aliases. This should be considered # optional as the repository also exposes alises for easy access to all dependencies. render_config = render_config( default_package_name = "" ),
) load("@crate_index//:defs.bzl", "crate_repositories") crate_repositories() Consuming dependencies may be more ergonomic in this case through the aliases defined in the new repository. load("@rules_rust//rust:defs.bzl", "rust_library", "rust_test") rust_library( name = "lib", deps = [ "@crate_index//:tokio", ], proc_macro_deps = [ "@crate_index//:async-trait", ],
) rust_test( name = "unit_test", crate = ":lib", deps = [ "@crate_index//:mockall", ],
